@charset "UTF-8";
/*
* Trunk version 2.0.0
*/
a:focus,
button:focus {
	outline: none !important;
}

button::-moz-focus-inner {
	border: 0;
}

*:focus {
	outline: none;
}

blockquote {
	padding: 0;
	margin: 0;
}

input,
button,
select,
textarea {
	outline: none;
}

label {
	margin-bottom: 0;
}

p {
	margin: 0;
}

ul,
ol {
	list-style: none;
	padding: 0;
	margin: 0;
}

ul li,
ol li {
	display: block;
}

dl {
	margin: 0;
}

dt,
dd {
	line-height: inherit;
}

dt {
	font-weight: inherit;
}

dd {
	margin-bottom: 0;
}

cite {
	font-style: normal;
}

form {
	margin-bottom: 0;
}

blockquote {
	padding-left: 0;
	border-left: 0;
}

address {
	margin-top: 0;
	margin-bottom: 0;
}

figure {
	margin-bottom: 0;
}

html p a:hover {
	text-decoration: none;
}

/*
*
* Typography
*/
body {
	font-family: "Work Sans", -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif;
	font-size: 14px;
	line-height: 1.7;
	font-weight: 300;
	color: #74757f;
	background-color: #fff;
	-webkit-text-size-adjust: none;
	-webkit-font-smoothing: subpixel-antialiased;
	letter-spacing: .03em;
}

@media (min-width: 768px) {
	body {
		font-size: 16px;
		line-height: 1.5;
	}
}

h1, h2, h3, h4, h5, h6, [class^='heading-'] {
	margin-top: 0;
	margin-bottom: 0;
	color: #151515;
}

h1 a:hover, h2 a:hover, h3 a:hover, h4 a:hover, h5 a:hover, h6 a:hover, [class^='heading-'] a:hover {
	color: #0045b6;
}

h1 span, h2 span, h3 span, h4 span, h5 span, h6 span, [class^='heading-'] span {
	display: inline-block;
}

h1 span[data-toggle='modal'], h2 span[data-toggle='modal'], h3 span[data-toggle='modal'], h4 span[data-toggle='modal'], h5 span[data-toggle='modal'], h6 span[data-toggle='modal'], [class^='heading-'] span[data-toggle='modal'] {
	border-bottom: 2px dashed rgba(0, 69, 182, 0.3);
	cursor: pointer;
}

h1 > span.icon, h2 > span.icon, h3 > span.icon, h4 > span.icon, h5 > span.icon, h6 > span.icon, [class^='heading-'] > span.icon {
	display: inline-block;
	margin-right: 5px;
}

h1,
.heading-1 {
	font-size: 30px;
	line-height: 1.15;
	letter-spacing: 0;
}

@media (min-width: 576px) {
	h1,
	.heading-1 {
		font-size: 32px;
	}
}

@media (min-width: 768px) {
	h1,
	.heading-1 {
		font-size: 46px;
		line-height: 1.25;
	}
}

@media (min-width: 992px) {
	h1,
	.heading-1 {
		font-size: 54px;
	}
}

@media (min-width: 1200px) {
	h1,
	.heading-1 {
		font-size: 58px;
	}
}

@media (min-width: 1600px) {
	h1,
	.heading-1 {
		font-size: 90px;
		line-height: 0.88889;
	}
}

h2,
.heading-2 {
	font-family: "Poppins", sans-serif;
	font-size: 28px;
	line-height: 1.4;
	letter-spacing: 0;
}

@media (min-width: 576px) {
	h2,
	.heading-2 {
		font-size: 30px;
	}
}

@media (min-width: 768px) {
	h2,
	.heading-2 {
		font-size: 44px;
	}
}

@media (min-width: 1200px) {
	h2,
	.heading-2 {
		font-size: 50px;
		line-height: 1.4;
	}
}

h3,
.heading-3 {
	font-size: 24px;
	line-height: 1.3;
	letter-spacing: 0;
}

@media (min-width: 768px) {
	h3,
	.heading-3 {
		font-size: 30px;
		line-height: 1.4;
	}
}

@media (min-width: 1200px) {
	h3,
	.heading-3 {
		font-size: 38px;
		line-height: 1.21053;
	}
}

h3 .big,
.heading-3 .big {
	font-size: 2em;
	line-height: 1;
}

h4,
.heading-4 {
	font-size: 18px;
	line-height: 1.5;
	letter-spacing: 0;
}

@media (min-width: 1200px) {
	h4,
	.heading-4 {
		font-size: 24px;
		line-height: 1.33333;
	}
}

h4.h4-smaller,
.heading-4.h4-smaller {
	font-size: 19px;
}

@media (min-width: 1200px) {
	h4.h4-smaller,
	.heading-4.h4-smaller {
		font-size: 22px;
		line-height: 1.45455;
	}
}

h5,
.heading-5 {
	font-size: 16px;
	line-height: 1.5;
	letter-spacing: .01em;
}

@media (min-width: 768px) {
	h5,
	.heading-5 {
		font-size: 22px;
		line-height: 1.27273;
	}
}

h6,
.heading-6 {
	font-family: "Poppins", sans-serif;
	font-size: 14px;
	line-height: 1.8;
	letter-spacing: .2em;
	text-transform: uppercase;
}

@media (min-width: 768px) {
	h6,
	.heading-6 {
		font-size: 16px;
		line-height: 1.5;
		font-weight: 700;
	}
}

.title-decorated {
	position: relative;
	padding-left: 40px;
	text-align: left;
}

.title-decorated::before {
	content: '';
	position: absolute;
	left: 0;
	top: 12px;
	width: 30px;
	border-bottom: 1px solid;
}

.title-docor-text {
	font-size: 20px;
	color: #fff;
}

@media (min-width: 576px) {
	.title-docor-text {
		font-size: 24px;
	}
}

@media (min-width: 768px) {
	.title-docor-text {
		padding-left: 96px;
		font-size: 37px;
	}
	.title-docor-text::before {
		width: 74px;
		border-bottom-width: 2px;
	}
}

@media (min-width: 768px) {
	.title-decorated-lg {
		padding-left: 80px;
	}
	.title-decorated-lg::before {
		width: 62px;
	}
	.title-decorated-lg + p {
		margin-top: 32px;
	}
}

small,
.small {
	display: block;
	font-size: 12px;
	line-height: 1.5;
}

mark,
.mark {
	padding: 3px 5px;
	color: #fff;
	background: #0045b6;
}

strong {
	font-weight: 700;
	color: #74757f;
}

.big {
	font-size: 16px;
	line-height: 1.55;
}

@media (min-width: 768px) {
	.big {
		font-size: 20px;
		line-height: 1.6;
	}
}

.lead {
	font-size: 24px;
	line-height: 34px;
	font-weight: 300;
}

code {
	padding: 4px 5px;
	border-radius: 0;
	font-size: 90%;
	color: #111111;
	background: #f5f6fa;
}

.text-large {
	font-family: "Poppins", sans-serif;
	font-size: 30px;
	font-weight: 500;
	letter-spacing: 0;
	line-height: 1.2;
	text-transform: uppercase;
}

@media (min-width: 576px) {
	.text-large {
		font-size: 55px;
	}
}

@media (min-width: 768px) {
	.text-large {
		font-size: 68px;
	}
}

@media (min-width: 992px) {
	.text-large {
		font-size: 80px;
	}
}

@media (min-width: 1200px) {
	.text-large {
		font-size: 100px;
	}
}

.context-dark .text-large, .bg-gray-700 .text-large, .bg-gray-800 .text-large, .bg-primary .text-large, .bg-primary-darker .text-large {
	color: #fff;
}

.text-extra-large {
	font-size: 100px;
	line-height: .8;
	font-weight: 800;
}

@media (min-width: 768px) {
	.text-extra-large {
		font-size: 130px;
		line-height: .7;
	}
}

@media (min-width: 992px) {
	.text-extra-large {
		font-size: 150px;
	}
}

@media (min-width: 1600px) {
	.text-extra-large {
		font-size: 180px;
	}
}

.wow-outer span {
	display: block;
}

.wow-outer .wow > span {
	display: inline;
}

p [data-toggle='tooltip'] {
	padding-left: .25em;
	padding-right: .25em;
	color: #0045b6;
}

p [style*='max-width'] {
	display: inline-block;
}

p a {
	color: inherit;
}

p .text-width-1 {
	display: inline-block;
	max-width: 730px;
}

.text-width-2 {
	display: inline-block;
	max-width: 350px;
}

.heading-subtitle {
	font-size: 24px;
	margin-top: 20px;
}

.about-subtitle {
	font-size: 20px;
	line-height: 32px;
	margin-top: 35px;
}

html .page .text-primary {
	color: #0045b6;
}

.price-property {
	font-size: 30px;
	font-family: "Poppins", sans-serif;
	line-height: 1;
}

@media (min-width: 768px) {
	.price-property {
		font-size: 40px;
	}
}

.page .text-danger {
	color: #dc0000;
}

.page .text-gray-700 {
	color: #495057;
}

.page .text-color-1 {
	color: #deef7f;
}

.context-dark .text-gray-700, .bg-gray-700 .text-gray-700, .bg-gray-800 .text-gray-700, .bg-primary .text-gray-700, .bg-primary-darker .text-gray-700 {
	color: #fff;
}

/*
*
* Brand
*/
.brand {
	display: inline-block;
}

.brand .brand-logo-light {
	display: none;
}

.brand .brand-logo-dark {
	display: block;
}

/*
*
* Links
*/
a {
	transition: all 0.3s ease-in-out;
}

a, a:focus, a:active, a:hover {
	text-decoration: none;
}

a, a:focus, a:active {
	color: #0045b6;
}

a:hover {
	color: #00286a;
}

a[href*='tel'], a[href*='mailto'] {
	white-space: nowrap;
}

.link-hover {
	color: #343db0;
}

.link-default, .link-default:active, .link-default:focus {
	color: #74757f;
}

.link-default:hover {
	color: #0045b6;
}

.context-dark .link-default, .bg-gray-700 .link-default, .bg-gray-800 .link-default, .bg-primary .link-default, .bg-primary-darker .link-default {
	color: #aeb1be;
}

.context-dark .link-default:hover, .bg-gray-700 .link-default:hover, .bg-gray-800 .link-default:hover, .bg-primary .link-default:hover, .bg-primary-darker .link-default:hover {
	color: #fff;
}

.link-image {
	display: block;
	max-width: 75%;
	margin-left: auto;
	margin-right: auto;
	opacity: .45;
	transition: all 0.3s ease-in-out;
}

.link-image:hover {
	opacity: 1;
}

.privacy-link {
	display: inline-block;
	color: #4854ed;
}

* + .privacy-link {
	margin-top: 25px;
}

/*
*
* Blocks
*/
.block-center, .block-sm, .block-lg {
	margin-left: auto;
	margin-right: auto;
}

.block-sm {
	max-width: 560px;
}

.block-lg {
	max-width: 768px;
}

.block-center {
	padding: 10px;
}

.block-center:hover .block-center-header {
	background-color: #0045b6;
}

.block-center-title {
	background-color: #fff;
}

@media (max-width: 1599.98px) {
	.block-center {
		padding: 20px;
	}
	.block-center:hover .block-center-header {
		background-color: #fff;
	}
	.block-center-header {
		background-color: #0045b6;
	}
}

/*
*
* Boxes
*/
.box-minimal {
	display: flex;
	margin-left: -15px;
	text-align: left;
}

.box-minimal > * {
	margin-left: 15px;
}

.box-chloe__icon {
	font-size: 26px;
}

.box-minimal-icon .box-chloe__icon {
	position: relative;
	top: 4px;
	min-width: 26px;
	font-size: 24px;
	line-height: 1;
	color: #0045b6;
}

.box-minimal-icon .box-chloe__icon.fl-bigmug-line-checkmark14 {
	font-size: 20px;
}

.box-minimal-icon .box-chloe__icon .box-chloe__icon {
	position: relative;
	top: 4px;
	min-width: 26px;
	font-size: 24px;
	line-height: 1;
}

.box-minimal-text {
	width: 100%;
	max-width: 320px;
	margin-left: auto;
	margin-right: auto;
}

* + .box-minimal {
	margin-top: 30px;
}

* + .box-minimal-title {
	margin-top: 10px;
}

* + .box-minimal-text {
	margin-top: 15px;
}

@media (max-width: 575.98px) {
	.box-minimal {
		max-width: 360px;
		margin-left: auto;
		margin-right: auto;
	}
}

@media (max-width: 767.98px) {
	.box-minimal * + p {
		margin-top: 7px;
	}
}

@media (min-width: 768px) {
	.box-minimal {
		padding-right: 15px;
		margin-left: -30px;
	}
	.box-minimal > * {
		margin-left: 30px;
	}
}

@media (min-width: 992px) and (max-width: 1199.98px) {
	.box-minimal {
		padding-right: 0;
	}
	.box-minimal-title {
		font-size: 22px;
	}
}

@media (min-width: 1200px) {
	.box-minimal-icon, .box-chloe__icon {
		top: 0;
		font-size: 36px;
	}
	.box-minimal-icon .box-chloe__icon, .box-chloe__icon .box-chloe__icon {
		font-size: 32px;
		top: 0;
	}
	.box-minimal-icon.fl-bigmug-line-checkmark14, .box-chloe__icon.fl-bigmug-line-checkmark14 {
		font-size: 30px;
	}
}

.box-light {
	text-align: left;
}

.box-light-icon {
	font-size: 30px;
	line-height: 1;
	color: #0045b6;
}

* + .box-light-title {
	margin-top: 10px;
}

@media (max-width: 575.98px) {
	.box-light {
		max-width: 300px;
		margin-left: auto;
		margin-right: auto;
	}
}

@media (min-width: 768px) {
	.box-light {
		max-width: 240px;
	}
	.box-chloe__icon {
		font-size: 32px;
	}
	* + .box-light-title {
		margin-top: 16px;
	}
}

@media (min-width: 768px) and (max-width: 1199.98px) {
	.box-light-title {
		font-size: 20px;
	}
}

@media (min-width: 992px) {
	.box-light-icon {
		font-size: 32px;
	}
	* + .box-light-title {
		margin-top: 25px;
	}
}

@media (min-width: 1200px) {
	.box-light-icon {
		font-size: 40px;
	}
}

.box-creative {
	max-width: 330px;
	margin-left: auto;
	margin-right: auto;
	text-align: center;
	cursor: default;
}

.box-creative:hover .box-creative-icon {
	color: #fff;
}

.box-creative:hover .box-creative-icon::after {
	opacity: 1;
	visibility: visible;
	transform: translate3d(0, 0, 0);
}

.box-creative-shadow .box-creative-icon {
	background: #fff;
	border: 0;
	box-shadow: 0 17px 24px 0 rgba(0, 0, 0, 0.05);
}

.box-creative-icon {
	position: relative;
	z-index: 0;
	display: inline-flex;
	align-items: center;
	justify-content: center;
	width: 2.8em;
	height: 2.8em;
	border: 2px solid #e8e9ee;
	border-radius: 50%;
	font-size: 24px;
	line-height: 1;
	color: #0045b6;
}

.box-creative-icon::before {
	position: relative;
	z-index: 2;
}

.box-creative-icon::after {
	content: '';
	position: absolute;
	top: 0;
	right: 0;
	bottom: 0;
	left: 0;
	z-index: -1;
	border-radius: inherit;
	background: #0045b6;
	border-color: #0045b6;
	pointer-events: none;
	opacity: 0;
	visibility: hidden;
	transition: .15s ease-in;
	transform: scale3d(1.05, 1.05, 1.05);
}

* + .box-creative-icon {
	margin-top: 10px;
}

* + .box-creative-title {
	margin-top: 10px;
}

@media (min-width: 768px) {
	.box-creative-icon {
		font-size: 30px;
	}
	* + .box-creative-title {
		margin-top: 15px;
	}
}

@media (max-width: 991.98px) {
	.box-creative * + p {
		margin-top: 10px;
	}
}

@media (min-width: 1200px) {
	.box-creative-icon {
		width: 2.4em;
		height: 2.4em;
		font-size: 40px;
	}
	* + .box-creative-title {
		margin-top: 24px;
	}
}

.box-1 {
	max-width: 280px;
	margin-left: auto;
	margin-right: auto;
}

@media (min-width: 768px) {
	.box-2 {
		padding-right: 30px;
	}
}

@media (min-width: 992px) {
	.box-2 {
		padding-right: 35px;
	}
}

@media (min-width: 1200px) {
	.box-2 {
		padding-right: 100px;
	}
}

@media (min-width: 992px) {
	.box-3 {
		padding-left: 10px;
	}
}

@media (min-width: 1200px) {
	.box-3 {
		padding-left: 70px;
	}
}

div.box-cta-1 {
	display: inline-table;
	text-align: center;
	vertical-align: middle;
	margin-bottom: -25px;
	margin-left: -40px;
}

div.box-cta-1:empty {
	margin-bottom: 0;
	margin-left: 0;
}

div.box-cta-1 > * {
	display: inline-block;
	margin: 0 0 25px 40px;
}

div.box-cta-1 > * {
	margin-top: 0;
	vertical-align: middle;
}

div.box-cta-thin {
	display: inline-table;
	text-align: center;
	vertical-align: middle;
	margin-bottom: -25px;
	margin-left: -30px;
}

div.box-cta-thin:empty {
	margin-bottom: 0;
	margin-left: 0;
}

div.box-cta-thin > * {
	display: inline-block;
	margin: 0 0 25px 30px;
}

div.box-cta-thin > * {
	margin-top: 0;
	vertical-align: middle;
}

@media (min-width: 768px) and (max-width: 991.98px) {
	div.box-cta-thin > * {
		max-width: 500px;
	}
}

.box-indigo {
	position: relative;
	padding: 5px 0 22px;
	max-width: 500px;
}

.box-indigo::before {
	content: '';
	position: absolute;
	top: 0;
	right: 100px;
	bottom: 0;
	left: 30px;
	z-index: -1;
	background: rgba(73, 80, 87, 0.12);
	pointer-events: none;
}

.box-indigo p {
	line-height: 1.35;
}

.box-indigo-header > * {
	padding-left: 60px;
}

.box-indigo-header > * + * {
	margin-top: 0;
}

.box-indigo-mark {
	font-weight: 300;
	color: #deef7f;
}

.box-indigo-title,
.box-indigo-subtitle {
	font-weight: 700;
	letter-spacing: 0;
	color: #495057;
}

p.box-indigo-title {
	position: relative;
	font-size: 30px;
	line-height: 1.15;
}

p.box-indigo-title::before {
	content: '';
	position: absolute;
	top: 50%;
	left: 0;
	transform: translate3d(0, -50%, 0);
	display: inline-block;
	width: 37px;
	height: 0.05em;
	margin-right: 15px;
	vertical-align: middle;
	background: #0045b6;
}

@media (min-width: 576px) {
	p.box-indigo-title {
		font-size: 60px;
	}
}

@media (min-width: 768px) {
	p.box-indigo-title {
		font-size: 75px;
		line-height: 1.2;
	}
}

p.box-indigo-subtitle {
	font-size: 24px;
	line-height: 1.2;
}

p.box-indigo-subtitle .box-indigo-mark {
	font-size: 0.85em;
}

@media (min-width: 576px) {
	p.box-indigo-subtitle {
		font-size: 34px;
	}
}

@media (min-width: 768px) {
	p.box-indigo-subtitle {
		font-size: 40px;
	}
}

.context-dark .box-indigo::before, .bg-gray-700 .box-indigo::before, .bg-gray-800 .box-indigo::before, .bg-primary .box-indigo::before, .bg-primary-darker .box-indigo::before {
	background: rgba(255, 255, 255, 0.12);
}

.context-dark .box-indigo p, .bg-gray-700 .box-indigo p, .bg-gray-800 .box-indigo p, .bg-primary .box-indigo p, .bg-primary-darker .box-indigo p {
	color: #aeb1be;
}

.context-dark p.box-indigo-title, .bg-gray-700 p.box-indigo-title, .bg-gray-800 p.box-indigo-title, .bg-primary p.box-indigo-title, .bg-primary-darker p.box-indigo-title,
.context-dark p.box-indigo-subtitle,
.bg-gray-700 p.box-indigo-subtitle,
