/*
*
* D3 Charts
*/
.c3 svg {
	padding-left: 4px;
	width: 100%;
	-webkit-tap-highlight-color: transparent;
}

.c3 path,
.c3 line {
	fill: none;
	stroke: #9f9f9f;
}

.c3 text {
	font-family: "Work Sans", -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif;
	font-size: 16px;
	fill: #9b9b9b;
	user-select: none;
}

.c3-legend-item-tile,
.c3-xgrid-focus,
.c3-ygrid,
.c3-event-rect,
.c3-bars path {
	shape-rendering: crispEdges;
}

.c3-chart-arc path {
	stroke: #fff;
}

.c3-chart-arc text {
	fill: #fff;
	font-size: 14px;
}

/*-- Axis --*/
/*-- Grid --*/
.c3-grid line {
	stroke: #eaebee;
}

.c3-grid text {
	fill: #aaa;
}

.c3-xgrid,
.c3-ygrid {
	stroke-dasharray: 0 0;
}

/*-- Text on Chart --*/
.c3-text.c3-empty {
	fill: #808080;
	font-size: 2em;
}

/*-- Line --*/
.c3-line {
	stroke-width: 3px;
}

/*-- Point --*/
.c3-circle._expanded_ {
	stroke-width: 2px;
	stroke: white;
}

.c3-selected-circle {
	fill: white;
	stroke-width: 2px;
}

/*-- Bar --*/
.c3-bar {
	stroke-width: 0;
}

.c3-bar._expanded_ {
	fill-opacity: 0.75;
}

/*-- Focus --*/
.c3-target.c3-focused {
	opacity: 1;
}

.c3-target.c3-focused path.c3-line,
.c3-target.c3-focused path.c3-step {
	stroke-width: 2px;
}

.c3-target.c3-defocused {
	opacity: 0.3 !important;
}

/*-- Region --*/
.c3-region {
	fill: steelblue;
	fill-opacity: .1;
}

/*-- Brush --*/
.c3-brush .extent {
	fill-opacity: .1;
	fill: #000;
}

/*-- Select - Drag --*/
/*-- Legend --*/
.c3-legend-item {
	font-size: 12px;
}

.c3-legend-item-hidden {
	opacity: 0.15;
}

.c3-legend-background {
	opacity: 0.75;
	fill: white;
	stroke: lightgray;
	stroke-width: 1;
}

/*-- Title --*/
.c3-title {
	font: 14px sans-serif;
}

/*-- Tooltip --*/
.c3-tooltip-container {
	z-index: 10;
}

.c3-tooltip {
	border-collapse: collapse;
	border-spacing: 0;
	background-color: #fff;
	empty-cells: show;
	opacity: 0.9;
	border: 1px solid #ccc;
}

.c3-tooltip tr {
	border: 1px solid #ccc;
}

.c3-tooltip th {
	background-color: #aaa;
	font-size: 14px;
	line-height: 1.2;
	padding: 2px 5px;
	text-align: left;
	color: #fff;
}

.c3-tooltip td {
	font-size: 13px;
	padding: 3px 6px;
	background-color: #fff;
	color: #000;
	border-left: 1px dotted #999;
}

.c3-tooltip td > span {
	display: inline-block;
	width: 10px;
	height: 10px;
	margin-right: 6px;
}

.c3-tooltip td.value {
	text-align: right;
}

/*-- Area --*/
.c3-area {
	stroke-width: 0;
	opacity: 0.2;
}

/*-- Arc --*/
.c3-chart-arcs-title {
	dominant-baseline: middle;
	font-size: 1.3em;
}

.c3-chart-arcs .c3-chart-arcs-background {
	fill: #e0e0e0;
	stroke: none;
}

.c3-chart-arcs .c3-chart-arcs-gauge-unit {
	fill: #000;
	font-size: 16px;
}

.c3-chart-arcs .c3-chart-arcs-gauge-max {
	fill: #777;
}

.c3-chart-arcs .c3-chart-arcs-gauge-min {
	fill: #777;
}

.c3-chart-arc .c3-gauge-value {
	fill: #000;
}

.c3 .domain {
	stroke: #c8c8c8;
}

.d3-chart .tick line {
	display: none;
}

.d3-chart .c3-tooltip {
	opacity: 1;
	color: #fff;
	background: #0045b6;
	border: 1px solid #aeb1be;
}

.d3-chart .c3-tooltip tr th {
	padding: 8px 10px;
	color: #fff;
	background: #495057;
}

.d3-chart .c3-tooltip tr td {
	padding: 5px 10px;
	color: #838386;
	background: #fff;
}

.d3-chart .c3-tooltip .value {
	border-left: 1px solid #f2f3f9;
}

